import React, { Component } from "react";

export class CreateBoard extends Component {
	CreateNewBoard = () => {
		console.log("new board create");
	};
	render() {
		return (
			<>
				<div
					onClick={this.CreateNewBoard}
					className=" bg-gray-300 h-20 w-1/5 inline-block cursor-pointer p-3  m-1 flex items-center justify-center text-gray-400"
				>
					create new board
				</div>
				<div
					className=" bg-black  absolute top-0 h-screen flex items-center justify-center "
					id="overlay"
				>
					<div className="bg-white  relative flex items-start justify-around w-5/12 h-3/4 py-10 px-5">
						<div>
							<h1 className="text-bold">{this.props.name}</h1>
							<p className="text-gray-500">
								in list
								<span className="italic underline ">{this.props.listName}</span>
							</p>
							<h1 className="text-bold my-4">Description</h1>
						</div>
						<div>
							<h1>Add to card</h1>
							<p>checklist</p>
						</div>
						<button
							onClick={this.handleClose}
							className="absolute top-0 right-0 p-10"
						>
							x
						</button>
					</div>
				</div>
			</>
		);
	}
}

export default CreateBoard;
